import React from 'react';
import './Navbar.css';

const navbar = () =>{
  return(
      <nav className="navbar--content">
        <span>PvE</span>
        <div className="navbar--item">
          <i class="fal fa-dungeon fa-2x"></i>Fractals
        </div>
        <div className="navbar--item">
          <i class="fal fa-chess-rook fa-2x"></i>WvW
        </div>
        <span><i className="fal fa-search fa-2x"></i></span>
      </nav>
  );
}

export default navbar;
